import FirebaseAuth from '../components/FirebaseAuth'
import Layout from '../components/Layout';

const Auth = () => {
    return (
        <div>
            <Layout>
                <div className="centerLayout">
                    <FirebaseAuth />
                </div>
            </Layout>
        </div>
    )
}

export default Auth
